body { 
  margin:0; 
  padding:0; 
  border:none; }
.pages { 

  & .suscripcionInfo { 
    background: -webkit-gradient(linear,  0 0, 0 100%, from(rgb(145, 49, 54)), color-stop(50%, rgb(93, 57, 134)), color-stop(90%, rgb(161, 155, 155)) ); 

    & .titulo { 
     text-align: center;
     display: inline-block;
     font-weight: 500;
     color: #fff;
     opacity: 1;
     transition: all 0.5s ease-in-out;
}

    & .imagen1 {
      float: left;
      width: 45%;
      margin-right: 1%;
      display: block;
      height: 500px;

    }
    & .imagen2 { 
     float: left;
    width: 40%;
    margin-right: 1%;
    display: block;
    height: 500px;
    border-color: blue
   }
    & .parrafo { 
      display: inline-block;
     font-weight: 800;
     color: #fff;
     opacity: 1;
     transition: all 0.5s ease-in-out;
    }
    & .suscripcionField { 
       margin:2%;
      clear: both;
      width: 35%;
      background-color: rgb(210, 207, 218);

    }
    & .socials { 
     margin:3%;
    display: flex;
    flex-direction: row;
    align-content:center;
    gap: 60px;
  }
  }
  }
